void MPCController::generateYref(float set_point_x, float yref[]){
    for (int i = 0; i < N; i+=2)
        yref[i] = set_point_x;
}

void MPCController::computeF_Bineq(const float x[], float yref[]){
    for(int i = 0; i < N; i++) {
        F[i] = 0.0;
        for(int j = 0; j < Nx; j++){
            F[i] += F1[i][j] * x[j];
        }
        for(int j = 0; j < Nx/2; j++){
            F[i] += F2[i][j] * yref[j];
        }

        Bineq[i] = 0.0;
        for(int j = 0; j < Nx; j++){
            Bineq[i] += G1[i][j] * x[j];
        }

        Bineq[i] += G2[i] * ulast;
        Bineq[i] += G3[i];
    }
}